import React, { useState, useEffect } from 'react';
import * as icons from 'react-icons/fa';
import * as api from '../library/api';
import * as ultility from '../library/ultility';

function Navbar({ isOpen }) {
    const [open, setOpen] = useState(true)
    const ToggleMobileNavbar = () => {
        setOpen(!open);
        isOpen(open);
    }
    useEffect(() => {
        ToggleMobileNavbar();
    }, [])
    const Logout = () => {
        api.Post("/Logout/", null, function (response) {
            if (response) {
                ultility.DeleteCookie("user");
                window.location.href = '/Login'
            }
        });
    }
    return (
        <>
            <nav className="navbar navbar-expand-lg">
                <div className="container-fluid d-flex align-items-center justify-content-between">
                    <div className="">
                        <i className={open ? "burger open" : "burger"} onClick={ToggleMobileNavbar}>
                            <span></span>
                            <span></span>
                            <span></span>
                        </i>
                    </div>
                    <div className="navbar-header">
                    </div>
                    <div className="dropdown show">
                        <a className="dropdown-toggle" href="#" role="button" id="dropdownMenuLink" data-toggle="dropdown" aria-haspopup="true" aria-expanded="false">
                            <icons.FaCog /> <icons.FaCaretDown />
                        </a>
                        <div className="dropdown-menu" aria-labelledby="dropdownMenuLink">
                            <a className="dropdown-item" href="#" onClick={Logout}>Logout <i><icons.FaSignOutAlt /></i></a>
                            <a className="dropdown-item" href="#">Account <i><icons.FaUser /> </i></a>
                        </div>
                    </div>
                </div>
            </nav>
        </>
    );
}

export default Navbar;
